import React from "react";
import { useSelector } from "react-redux";

const Users = () => {
  const { users } = useSelector((state) => state);

  return (
    <div>
      {users.map((user, index) => {
        return (
          <div className='forEachUsernameDiv'>
            <h1>{user.username}</h1>
          </div>
        );
      })}
    </div>
  );
};

export default Users;
